const API_URL = 'https://localhost:8080';

export const API_ROUTES = {
  login: `${API_URL}/login`,
  signup: `${API_URL}/addUser`,
  sendEmail: `${API_URL}/send-email`,
  PasswordReset: `${API_URL}/api/reset-password`
};
